import React from 'react';
import { Navbar, Container, Nav } from 'react-bootstrap';

function Header() {
    return (
        <Navbar bg="light" expand="lg">
            <Container className="d-flex justify-content--between">
                <Navbar.Brand href="#home">Мой Заголовок</Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="me-auto">
                        <Nav.Link href="#home">Мои проверки</Nav.Link>
                        <Nav.Link href="#link">Добавить проверку</Nav.Link>
                        <Nav.Link href="#link">История проверок</Nav.Link>
                        <Nav.Link href="#link">Статистика</Nav.Link>
                    </Nav>
                </Navbar.Collapse>
            </Container>
        </Navbar>
    );
}

export default Header;
